该经过自己的思考或查看文档后再提出",author:"作者邮箱：anqi4051{'@'}gmail.com",qa:[{q:"为什么仓库一直加载失败？（仅针对在线仓库）",a:"仓库使用的是github的地址，国内直接连接可能会时好时坏，属正常现象，打不开就多试几次或者过几分钟再来试试，也可以使用BGI的本地仓库页面。（如果你是一个魔法师，你知道怎么做）"},{q:"仓库使用教程？",a:"见BGI官网：用户手册-脚本仓库。"},{q:"最近更新为什么下次打开就没了？",a:"受限于目前的数据获取方式，当你点击过有更新提示的脚本或清除红点后后就会标识为没更新了，可能未来会解决。"},{q:"一键更新不可以只更新有更新的或者自己选吗？",a:"有两个原因，1是同上一问的最近更新，2是作者最近没有时间实现（也就是我）。"},{q:"评论功能为什么不可用？",a:"本地模式下不支持评论，请访问在线仓库并登录github账号后评论，如何使用github需要自行解决。"},{q:"为什么没有XX脚本？",a:"善用搜索，搜索时尽量保证关键词准确，如“甜甜花”，或者“伐木”搜不到就搜“砍树”。如果每一个都找过后仍未找到，那么就是没有作者写，可以自行尝试编写一个。"},{q:"README是什么，为什么加载失败了？为什么没有显示？",a:"朗读一遍单词README，读懂了吗？加载失败情况同第一问。没显示是因为该目录下不存在README.md文件。"},{q:"一些链接为什么点不开？加载半天为什么加载不出来？",a:"同第一问。"},{q:"点击订阅后为什么没反应？",a:"请打开BGI，这时会有导入窗口弹出，选择导入。如果你使用的是在线仓库，刷新BGI页面后没有你订阅的脚本，请更新本地仓库后重试，还有异常请在相关群中提问。"},{q:"这个脚本用不了怎么办？",a:"请在相关群中提问，具体问题具体分析，提问时确保你的截图和描述充分。"},{q:"我之前的评论怎么不见了？",a:"一般不会删评，如果评论消失大概率是你评论的节点路径改变了，比如水晶矿这个目录被改名成了晶水矿，那就会导致你看到的是新的评论区。"},{q:"这个脚本为什么不用纳西妲？",a:"作者们都需要考虑是不是所有人都有，如果需要请尝试自己做一个。"},{q:"我想要XX功能怎么办？",a:"没有作者写那就自己写一个！"},{q:"其它",a:"如仍有问题可先在官网查找，若官网与此处均无法找到，请联系我。"}]},WK={descTitle:"简介：",noDesc:"无简介",loadTimeout:"加载超时",loadFailed:"加载失败",clickToViewFile:"点击查看GitHub仓库中的文件",clickToViewDir:"点击查看GitHub仓库中的目录",invalidLinkHint:"（这个作者很笨，把链接写错了，去提醒ta修改吧）",iframeNotice:"由于安全限制，无法直接显示此内容，请使用本地仓库查看"},qK={help:"帮助",jumpToGitHub:"GitHub",comment:"评论",subscribe:"一键更新",update:"查看更新",plan:"更新计划",recent:"以下脚本最近有更新",updateAll:"是否一键更新所有已订阅项",clearDot:"清除红点提示",subscribed:"已订阅",confirm:"确定",cancel:"取消"},KK={subscribed:"已订阅",subscribe:"订阅",subscribeAgain:"再次订阅",selectValidNode:"请选择一个有效的节点进行订阅",subscribeFailed:"订阅失败",subscribeFailedWithMsg:"订阅失败: {msg}",subscribeSuccess:"已将 {name} 的订阅链接复制到剪贴板",copyFailed:"复制 {name} 的订阅链接失败",noDesc:"无简介"},jK={hasUpdate:"有更新",subscribed:"已订阅",noAuthor:"佚名"},XK={hasUpdate:"有更新",subscribed:"已订阅",noAuthor:"佚名"},QK={hasUpdate:"有更新",subscribed:"已订阅",noAuthor:"佚名"},ZK={comma:"，",noDesc:"无简介",reset:"重置",confirm:"确定"},JK={author:"作者：",scriptAuthor:"作者",noAuthor:"佚名",subscribe:"订阅",subscribed:"已订阅",s 定為30648。完成後請關閉此頁面並重新啟動BGI再次嘗試，仍有問題請聯繫作者解決。"},{q:"README是什麼，為什麼載入失敗了？為什麼沒有顯示？",a:"自己先讀一遍README，讀懂了嗎？載入失敗情況同第一問。沒顯示是因為該目錄下不存在README.md檔案。"},{q:"一些連結為什麼點不開？載入半天為什麼載入不出來？",a:"同第一問。"},{q:"點擊訂閱後為什麼沒反應？",a:"請開啟BGI，這時會有匯入視窗彈出，選擇匯入。如果你使用的是線上倉庫，重新整理BGI頁面後沒有你訂閱的腳本，請更新本地倉庫後重試，還有異常請在相關群中提問。"},{q:"這個腳本用不了怎麼辦？",a:"請在相關群中提問，具體問題具體分析，提問時確保你的截圖和描述充分。"},{q:"我之前的評論怎麼不見了？",a:"一般不會刪評，如果評論消失大概率是你評論的節點路徑改變了，比如水晶礦這個目錄被改名成了晶水礦，那就會導致你看到的是新的評論區。"},{q:"這個腳本為什麼不用納西妲？",a:"作者們都需要考慮是不是所有人都有，如果需要請嘗試自己做一個。"},{q:"我想要XX功能怎麼辦？",a:"沒有作者寫那就自己寫一個！"},{q:"其它",a:"更多問題請聯繫我，如有價值也會不定期更新該頁面。"}]},fj={descTitle:"簡介：",noDesc:"無簡介",loadTimeout:"載入超時",loadFailed:"載入失敗",clickToViewFile:"點擊查看GitHub倉庫中的檔案",clickToViewDir:"點擊查看GitHub倉庫中的目錄",invalidLinkHint:"（這個作者很笨，把連結寫錯了，去提醒ta修改吧）",iframeNotice:"由於安全限制，無法直接顯示此內容，請使用本地倉庫查看"},pj={help:"說明",jumpToGitHub:"GitHub",comment:"評論",subscribe:"一鍵更新",update:"查看更新",plan:"更新計劃",recent:"以下腳本最近有更新",updateAll:"是否一鍵更新所有已訂閱項",clearDot:"清除紅點提示",subscribed:"已訂閱",confirm:"確認",cancel:"取消"},mj={subscribed:"已訂閱",subscribe:"訂閱",subscribeAgain:"再次訂閱",selectValidNode:"請選擇一個有效的節點進行訂閱",subscribeFailed:"訂閱失敗",subscribeFailedWithMsg:"訂閱失敗: {msg}",subscribeSuccess:"已將 {name} 的訂閱連結複製到剪貼簿",copyFailed:"複製 {name} 的訂閱連結失敗",noDesc:"無簡介"},gj={hasUpdate:"有更新",subscribed:"已訂閱",noAuthor:"佚名"},_j={hasUpdate:"有更新",subscribed:"已訂閱",noAuthor:"佚名"},hj={hasUpdate:"有更新",subscribed:"已訂閱",noAuthor:"佚名"},vj={comma:"，",noDesc:"無簡介",reset:"重置",confirm:"確定"},bj={author:"作者：",scriptAuthor:"作者",noAuthor:"佚名",subscribe:"訂閱",subscribed:"已訂閱",subscribeAgain:"再次訂閱",subscribeFailed:"訂閱失敗",subscribeFailedWithMsg:"訂閱失敗: {msg}",subscribeSuccess:"已將 {name} 的訂閱連結複製到剪貼簿",copyFailed:"複製 {name} 的訂閱連結失敗",loadingReadme:"正在載入readme檔案",readmeFailed:"readme檔案載入失敗，請重試",loadingStrategy:"正在載入策略檔案內容",strategyFailed:"策略檔案載入失敗，請重試",empty:"請選擇左側腳本查看詳情",desc:"簡介：",tabReadme:"簡介",tabFiles:"檔案列表",noFiles:"暫無檔案資料",modalTitle:"檔案詳情",name:"名稱",tags:"標籤",lastUpdated:"更新時間",operations:"操作",hash:"hash",description:"描述",version:"版本",path:"路徑",details:"詳情",showDe  be resizable by dragging rather than fixed values, and save the data locally (consider adding a configuration file in the main body if caching is unreliable)."},{desc:"More Powerful Search",content:"Enhance the search function. The current search is only keyword detection; fuzzy matching needs to be considered (this item has low priority, as it's a lot of effort for little reward)."},{desc:"More Advanced Animations",content:"Provide more animation effects for UI interactions."},{desc:"Improve the Updated Scripts List",content:"Add a route-like mechanism (but not actual routing) to the page, allowing click-to-navigate within the update view."},{desc:"Author's Whisper",content:"I won't write the whisper in the title, ehe! Currently, the author is quite busy juggling personal projects, studies, and work. Please don't blame me for the slow updates, wuwuwu. The best way to urge me to update is to sponsor the author or give this humble author a star (if you don't know what a star is, just forget it)."}]},Dj={title:"FAQ Q&A",modalTitle:"Note: Any questions should be thought through or documented before asking",author:"Author email: anqi4051{'@'}gmail.com",qa:[{q:"Why does the repository keep failing to load?",a:"The repository uses GitHub addresses, and direct connections from China may be intermittent, which is normal. If it doesn't open, try a few more times or come back in a few minutes. You can also use BGI's local repository page. (If you're a wizard, you know what to do)"},{q:"Why is the comment function unavailable?",a:"Comments are not supported in local mode. Please visit the online repository and log in to your GitHub account to comment. How to use GitHub, please search for yourself."},{q:"Why is there no XX script?",a:`When searching, try to ensure keywords are accurate, such as "Sweet Flower". If you've searched everything and still can't find it, then no author has written it. You can try writing one yourself.`},{q:"How to use the subscribed function?",a:`"BetterGI → Settings → BetterGI Http Server Settings" (if you can't find this setting, please make sure BGI is updated to the latest version), ensure this item is enabled and the port number is set to 30648. After completion, please close this page and restart BGI to try again. If there are still issues, please contact the author for resolution.`},{q:"What is README, why did it fail to load? Why is it not displayed?",a:"Read the README yourself first, do you understand it? Loading failure is the same as the first question. It's not displayed because there's no README.md file in that directory."},{q:"Why can't some links be clicked? Why does it load for a long time without loading?",a:"Same as the first question."},{q:"Why is there no response after clicking subscribe?",a:"Please open BGI, an import window will pop up, select import. If you're using the online repository and the script you subscribed to doesn't appear after refreshing the BGI page, please update the local repository and try again. If there are still issues, please ask in the relevant group."},{q:"What should I do if this script doesn't work?",a:"Please ask in the relevant group, specific problems require specific analysis. When asking, make sure your screenshots and descriptions are sufficient."},{q:"Why are my previous comments gone?",a:"Comments are generally not deleted. If comments disappear, it's likely because the node path you commented on has changed. For example, if the Crystal Ore directory was renamed to Crystal Water Ore, you'll see a new comment section."},{q:"Why doesn't this script use Nahida?",a:"Authors need to consider whether everyone has her. If needed, try making one yourself."},{q:"What should I do if I want XX function?",a:"If no author has written it, write one yourself!"},{q:"Others",a:"For more questions, please contact me. If valuable, this page will be updated periodically."}]},$j={descTitle:"Description: ",noDesc:"No description",loadTimeout:"Load timeout",loadFailed:"Load f  comments","comment.onlineRepo":"Visit Online Repository","egg.failed":"Failed to load despite best efforts, please retry","egg.title":"Easter Egg","egg.loading":"Easter egg is trying its best to load...","script.searchMap":"Search resource name, author, tag","script.onlyLocal":"Only available in local mode","comment.title":"Comments","script.searchScript":"Search script name, author, description, tag","script.searchCombat":"Search combat strategy name, author, tag","script.searchTCG":"Search TCG strategy name, author, tag","script.searchDefault":"Enter keywords to search"},Yj={map:"マップ追跡",script:"Javascript スクリプト",combat:"戦闘戦略",tcg:"七聖召喚戦略"},Wj={ok:"確定",cancel:"キャンセル",refresh:"ページを更新",help:"ヘルプを表示",all:"すべて",subscribed:"購読済み",visitOnline:"オンラインリポジトリにアクセス"},qj={repoTitle:"スクリプトリポジトリ",mainRepo:"BetterGIメインリポジトリにアクセス",scriptRepo:"BetterGIスクリプトリポジトリにアクセス",onlineRepo:"オンラインリポジトリにアクセス",otherExtensions:"その他の拡張機能",lastUpdate:"最終更新：",document:"公式ドキュメントを確認する"},Kj={all:"すべて",subscribed:"購読済み",onlyLocal:"ローカルモードでのみ利用可能",searchMap:"リソース名、作者、タグを検索",searchScript:"キーワードを入力して検索",searchCombat:"キーワードを入力して検索",searchTCG:"キーワードを入力して検索",searchDefault:"キーワードを入力して検索",author:"作者：",noAuthor:"匿名",unknown:"不明なスクリプト"},jj={repoTitle:"リポジトリ情報の取得に失敗しました",repoDesc:"ネットワークを確認するか、後でページを更新してください"},Xj={title:"コメント",localModeTitle:"ローカルモードではコメント機能がサポートされていません",localModeDesc:"オンラインリポジトリでコメントしてください"},Qj={title:"イースターエッグ",loading:"イースターエッグが全力で読み込み中…",error:"全力を尽くしましたが、読み込みに失敗しました。再試行してください"},Zj={title:"更新計画",desc:"以下は今後の更新計画です。皆さんのご意見や実装へのご協力をお待ちしています。現在、作者は私一人のみのため、更新速度はあまり速くありません。ご了承ください！",link:"リポジトリページアドレス：https://github.com/zaodonganqi/bettergi-script-web",author:"作者メール：anqi4051{'@'}gmail.com",planList:[{desc:"テーマカラーサポート",content:"より多くのテーマカラー（非常にシンプルで、手伝ってくれる開発者がテーマカラーを作成することを期待）と専用の管理ポップアップ、半透明テーマとカスタムテーマのサポート（リポジトリjs形式でテーマカラー設定jsonを保存し取得、ローカルキャッシュで現在の使用状況を保存）、半透明モードでのカスタム背景画像のサポート。"},{desc:"ワンクリック購読の強化",content:"更新されたスクリプトの中から既に購読しているスクリプトを探し、ワンクリックで更新できるスクリプトをフィルタリングします。もちろん、今の全てを盲目的に更新するのもそれほど遅くはありません。"},{desc:"内部チュートリアルドキュメントの追加（解決済み、公式ドキュメントで確認可能）",content:"ツールバーにリポジトリの使用チュートリアルを追加して、コンピュータ初心者向けに提供します。"},{desc:"コンテンツ領域のドラッグ可能化（解決済み、サイドバーをドラッグしてみてください）",content:"リストなどのビューを、現在の固定値ではなくドラッグでサイズ変更可能なビューに変更し、データをローカルに保存します（キャッシュが信頼できない場合は、本体に設定ファイルを追加することを検討します）。"},{desc:"より強力な検索",content:"検索機能の強化。現在の検索はキーワード検出のみです。あいまい一致を検討する必要があります（この項目の優先度は高くなく、労力の割に効果が薄いです）。"},{desc:"より高度なアニメーション",content:"UIインタラクションにより多くの動的効果を提供します。"},{desc:"更新済みスクリプトリストの改善",content:"ページにルートに似たメカニズム（ただしルーティングではありません）を追加し、更新確認画面内でクリックして移動できるようにします。"},{desc:"作者のささやき",content:"ささやきはタイトルには書きませんよ、えへっ！現在、作者は個人の事業、学業、仕事を両立させており、非常に忙しいです。更新が遅いからといって責めないでください、呜呜呜。更新を促す最善の方法は、作者をスポンサーになるか、卑しい作者にスターを付けることです（スターが何か分からない場合は、気にしないでください）。"}]},Jj={title:"よくある質問 Q&A",modalTitle:"事前注意：質問する前に自分で考えたり、ドキュメントを確認してください",author:"作者メール：anqi4051{'@'}gmail.com",qa:[{q:"なぜリポジトリが常に読み込みに失敗するのですか？",a:"リポジトリはGitHubのアドレスを使用しており、中国からの直接接続は断続的になる可能性があり、これは正常な現象です。開かない場合は何度か試すか、数分後に再試行してください。BGIのローカルリポジトリページも使用できます。（魔法使いの方は、どうすればよいかご存知です）"},{q:"なぜコメント機能が利用できないのですか？",a:"ローカルモードではコメントがサポートされていません。オンラインリポジトリにアクセスしてGitHubアカウントにログインしてからコメントしてください。GitHubの使用方法は自分で調べてください。"},{q:"なぜXXスクリプトがないのですか？",a:"検索する際は、キーワードが正確であることを確認してください。例えば「スイートフラワー」などです。すべてを検索しても見つからない場合は、作者が書いていないということです。自分で書いてみることもできます。"},{q:"購読機能はどのように使用しますか？",a:"「BetterGI → 設定 → BetterGI Http サーバー設定」（この設定が見つからない場合は、BGIが最新版に更新されていることを確認してください）、この項目が有効で、ポート番号が30648に設定されていることを確認してください。完了後、このページを閉じてBGIを再起動して再試行してください。まだ問題がある場合は、作者に連絡して解決してください。"},{q:"READMEとは何ですか、なぜ読み込みに失敗したのですか？なぜ表示されないのですか？",a:"まずREADMEを読んでください、理解できましたか？読み込み失敗は最初の質問と同じです。表示されないのは、そのディレクトリにREADME.mdファイルが存在しないからです。"},{q:"なぜ一部のリンクがクリックできないのですか？なぜ長時間読み込みしても読み込まれないのですか？",a:"最初の質問と同じです。"},{q:"購読をクリックした後、なぜ反応がないのですか？",a:"BGIを開いてください。この時、インポートウィンドウがポップアップします。インポートを選択してください。オンラインリポジトリを使用している場合、BGIページを更新した後、購読したスクリプトが表示されない場合は、ローカルリポジトリを更新して再試行してください。まだ異常がある場合は、関連グループで質問してください。"},{q:"このスクリプトが使えない場合はどうすればよいですか？",a:"関連グループで質問してください。具体的な問題は具体的に分析します。質問する際は、スクリーンショットと説明が十分であることを確認してください。"},{q:"以前のコメントがなぜ消えたのですか？",a:"一般的にコメントは削除されません。コメントが消えた場合、コメントしたノードパスが変更された可能性が高いです。例えば、クリスタル鉱石ディレクトリがクリスタルウォーター鉱石に名前が変更された場合、新しいコメントセクションが表示されます。"},{q:"なぜこのスクリプトはナヒーダを使用しないのですか？",a:"作者は全員が持っているかどうかを考慮する必要があります。必要な場合は、自分で作ってみてください。"},{q:"XX機能が欲しい場合はどうすればよいですか？",a:"作者が書いていない場合は、自分で書いてください！"},{q:"その他",a:"その他の質問については、私に連絡してください。価値がある場合は、このページも不定期に更新されます。"}]},eX={descTitle:"説明：",noDesc:"説明なし",loadTimeout:"読み込みタイムアウト",loadFailed:"読み込み失敗",clickToViewFile:"GitHubリポジトリのファイルをクリックして表示",clickToViewDir:"GitHubリポジトリのディレクトリをクリックして表示",invalidLinkHint:"（この作者は愚かでリンクを間違えました。修正するよう彼らに伝えてください）"},tX={help:"ヘルプ",jumpToGitHub:"GitHub",comment:"コメント",subscribe:"ワンクリック更新",update:"更新を確認",plan:"更新計画",recent:"最近の更新",updateAll:"全ての購読を更新しますか？",clearDot:"赤い点を消す",subscribed:"購読済み",confirm:"確認",cancel:"キャンセル"},nX={subscribed:"購読済み",subscribe:"購読",subscribeAgain:"再購読",selectValidNode:"購読する有効なノードを選択してください",subscribeFailed:"購読に失敗しました",subscribeFailedWithMsg:"購読に失敗しました: {msg}",subscribeSuccess:"{name}の購読リンクがクリップボードにコピーされました",copyFailed:"{name}の購読リンクのコピーに失敗しました",noDesc:"なし"},rX={hasUpdate:"更新あり",subscribed:"購読済み",noAuthor:"匿名"},oX={hasUpdate:"更新あり",subscribed:"購読済み",noAuthor:"匿名"},aX={hasUpdate:"更新あり",subscribed:"購読済み",noAuthor:"匿名"},iX={comma:"、",noDesc:"説明なし",reset:"リセット",confirm:"確定"},lX={author:"作者：",scriptAuthor:"作者",noAuthor:"匿名",subscribe:"購読",subscribed:"購読済み",subscribeAgain:"再購読",subscribeFailed:"購読に失敗しました",subscribeFailedWithMsg:"購読に失敗しました: {msg}",subscribeSuccess:"{name}の購読リンクがクリップボードにコピーされました",copyFailed:"{name}の購読リンクのコピーに失敗しました",loadingReadme:"readmeファイルを読み込み中",readmeFailed:"readmeファイルの読み込みに失敗しました。再試行してください",loadingStrategy:"戦略ファイルの内容を読み込み中",strategyFailed:"戦略ファイルの読み込みに失敗しました。再試行してください",empty:"左側のスクリプトを選択して詳細を表示してください",desc:"説明：",tabReadme:"説明",tabFiles:"ファイルリスト",noFiles:"ファイルデータなし",modalTitle:"ファイル詳細",name:"名前",tags:"タグ",lastUpdated:"最終更新",operations:"操作",hash:"ハッシュ",description:"説明",version:"バージョン",path:"パス",details:"詳細",showDetails:"詳細"},sX={title:"設定",language:"言語を選択",zhCN:"簡体中国語",zhTW:"繁体中国語",enUS:"英語",jaJP:"日本語",fr e Dépôt en Ligne",otherExtensions:"Autres Extensions",lastUpdate:"Dernière Mise à Jour : ",document:"Consultez la documentation officielle"},gX={all:"Tout",subscribed:"Abonné",onlyLocal:"Disponible uniquement en mode local",searchMap:"Rechercher nom de ressource, auteur, tag",searchScript:"Entrer des mots-clés pour rechercher",searchCombat:"Entrer des mots-clés pour rechercher",searchTCG:"Entrer des mots-clés pour rechercher",searchDefault:"Entrer des mots-clés pour rechercher",author:"Auteur : ",noAuthor:"Anonyme",unknown:"Script Inconnu"},_X={repoTitle:"Échec de récupération des informations du dépôt",repoDesc:"Vérifiez votre réseau ou actualisez la page plus tard"},hX={title:"Commentaires",localModeTitle:"Les commentaires ne sont pas pris en charge en mode local",localModeDesc:"Veuillez visiter le dépôt en ligne pour les commentaires"},vX={title:"Easter Egg",loading:"L'easter egg fait de son mieux pour charger...",error:"Échec du chargement malgré tous les efforts, veuillez réessayer"},bX={title:"Plan de Mise à Jour",desc:"Voici quelques plans de mise à jour futurs. Toutes les contributions ou aides pour leur mise en œuvre sont les bienvenues. Pour le moment, je suis le seul auteur, donc la vitesse de mise à jour ne sera pas très rapide. Merci de votre compréhension !",link:"URL du Dépôt : https://github.com/zaodonganqi/bettergi-script-web",author:"Email de l'Auteur : anqi4051{'@'}gmail.com",planList:[{desc:"Support des Couleurs de Thème",content:"Plus de couleurs de thème (très simple, en espérant que les développeurs qui veulent aider créeront des couleurs de thème) et des popups de gestion dédiés, supportant les thèmes translucides et les thèmes personnalisés (stockage de la configuration des couleurs de thème json via le formulaire js du dépôt et obtention, cache local stockant l'utilisation actuelle), supportant les images d'arrière-plan personnalisées en mode translucide."},{desc:"Renforcer l'Abonnement en un Clic",content:"Trouvez les scripts que vous avez déjà abonnés parmi les scripts mis à jour pour filtrer ceux qui peuvent être mis à jour en un clic. Bien sûr, mettre à jour tous les scripts aveuglément n'est pas très lent de toute façon."},{desc:"Ajouter une Documentation de Tutoriel Interne (Résolu, peut être consulté dans la documentation officielle)",content:"Ajoutez un tutoriel d'utilisation du dépôt dans la barre d'outils pour les novices en informatique."},{desc:"Zones de Contenu Déplaçables (Résolu, essayez de faire glisser la barre latérale)",content:"Modifiez les vues comme les listes pour qu'elles soient redimensionnables par glisser-déposer plutôt que fixes, et enregistrez les données localement (envisagez d'ajouter un fichier de configuration dans le corps principal si la mise en cache n'est pas fiable)."},{desc:"Recherche Plus Puissante",content:"Améliorez la fonction de recherche. La recherche actuelle n'est qu'une détection de mots-clés ; une correspondance approximative doit être envisagée (cet élément a une faible priorité, car c'est beaucoup d'effort pour peu de résultats)."},{desc:"Animations Plus Avancées",content:"Fournissez plus d'effets d'animation pour les interactions de l'interface utilisateur."},{desc:"Améliorer la Liste des Scripts Mis à Jour",content:"Ajoutez un mécanisme de type routage (mais pas un routage réel) à la page, permettant de naviguer par un clic dans la vue des mises à jour."},{desc:"Confidence de l'Auteur",content:"Je n'écrirai pas la confidence dans le titre, héhé ! Actuellement, l'auteur est assez occupé à jongler avec des projets personnels, des études et du travail. S'il vous plaît, ne me blâmez pas pour les mises à jour lentes, wuwuwu. La meilleure façon de me pousser à mettre à jour est de sponsoriser l'auteur ou de donner une étoile à cet humble auteur (si vous ne savez pas ce qu'est une étoile, oubliez ça)."}]},SX={title:"FAQ Q&A",modalTitle:"Note : Toute question doit être réfléchie ou documentée avant d'être posée",author:"Email de l'auteur : anqi4051{'@'}gmail.com",qa:[{q:"Pourquoi le dépôt échoue-t-il toujours à charger ?",a:"Le dépôt utilise des adresses GitHub, et les connexions directes depuis la Chine peuvent être intermittentes, ce qui est normal. Si cela ne s'ouvre pas, essayez plusieurs fois ou revenez dans quelques minutes. Vous pouvez aussi utiliser la page de dépôt local de BGI. (Si vous êtes un magicien, vous savez quoi faire)"},{q:"Pourquoi la fonction de commentaire n'est-elle pas disponible ?",a:"Les commentaires ne sont pas pris en charge en mode local. Veuillez visiter le dépôt en ligne et vous connecter à votre compte GitHub pour commenter. Comment utiliser GitHub, veuillez chercher vous-même."},{q:"Pourquoi n'y a-t-il pas de script XX ?",a:`Lors de la recherche, essayez de vous assurer que les mots-clés sont précis, comme "Fleur Douce". Si vous avez tout cherché et que vous ne le trouvez toujours pas, alors aucun auteur ne l'a écrit. Vous pouvez essayer d'en écrire un vous-même.`},{q:"Comment utiliser la fonction abonné ?",a:`"BetterGI → Paramètres → Paramètres du Serveur Http BetterGI" (si vous ne trouvez pas ce paramètre, assurez-vous que BGI est mis à jour vers la dernière version), assurez-vous que cet élément est activé et que le numéro de port est défini sur 30648. Après avoir terminé, fermez cette page et redémarrez BGI pour réessayer. S'il y a encore des problèmes, contactez l'auteur pour résolution.`},{q:"Qu'est-ce que README, pourquoi a-t-il échoué à charger ? Pourquoi n'est-il pas affiché ?",a:"Lisez d'abord README vous-même, comprenez-vous ? L'échec de chargement est le même que la première question. Il n'est pas affiché car il n'y a pas de fichier README.md dans ce répertoire."},{q:"Pourquoi certains liens ne peuvent-ils pas être cliqués ? Pourquoi cela charge-t-il longtemps sans charger ?",a:"Même que la première question."},{q:"Pourquoi n'y a-t-il pas de réponse après avoir cliqué sur s'abonner ?",a:"Veuillez ouvrir BGI, une fenêtre d'importation apparaîtra, sélectionnez importer. Si vous utilisez le dépôt en ligne et que le script auquel vous vous êtes abonné n'apparaît pas après avoir actualisé la page BGI, mettez à jour le dépôt local et réessayez. S'il y a encore des problèmes, demandez dans le groupe pertinent."},{q:"Que faire si ce script ne fonctionne pas ?",a:"Veuillez demander dans le groupe pertinent, les problèmes spécifiques nécessitent une analyse spécifique. Lors de la demande, assurez-vous que vos captures d'écran et descriptions sont suffisantes."},{q:"Pourquoi mes commentaires précédents ont-ils disparu ?",a:"Les commentaires ne sont généralement pas supprimés. Si les commentaires disparaissent, il est probable que le chemin du nœud sur lequel vous avez commenté ait changé. Par exemple, si le répertoire Crystal Ore a été renommé en Crystal Water Ore, vous verrez une nouvelle section de commentaires."},{q:"Pourquoi ce script n'utilise-t-il pas Nahida ?",a:"Les auteurs doivent considérer si tout le monde l'a. Si nécessaire, essayez d'en faire un vous-même."},{q:"Que faire si je veux la fonction XX ?",a:"Si aucun auteur ne l'a écrit, écrivez-en un vous-même !"},{q:"Autres",a:"Pour plus de questions, contactez-moi. Si c'est précieux, cette page sera mise à jour périodiquement."}]},EX={descTitle:"Description : ",noDesc:"Aucune description",loadTimeout:"Délai d'attente de chargement",loadFailed:"Échec du chargement",clickToViewFile:"Cliquez pour voir le fichier dans le dépôt GitHub",clickToViewDir:"Cliquez pour voir le répertoire dans le dépôt GitHub",invalidLinkHint:"(Cet auteur est stupide et a mal écrit le lien, allez lui rappeler de le corriger)",iframeNotice:"En raison des restrictions de sécurité, ce contenu ne peut pas être affiché directement. Veuillez utiliser le dépôt local pour le visualiser"},yX={help:"Aide",jumpToGitHub:"GitHub",comment:"Commentaire",subscribe:"Mise à jour en un clic",update:"Vérifier les mises à jour",plan:"Plan de mise à jour",recent:"Mises à jour récentes",updateAll:"Mettre à jour tous les abonnements ?"
